import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <h1 className="clinic-name">Elite Dental Clinic</h1>
      <div className="doctors">
        <p>Dr. Chikku Poulo, BDS</p>
        <p>Dr. Gayathri Balagopal, BDS</p>
      </div>
    </header>
  );
};

export default Header;
